class Navbar extends Component {

    render() {
        return (
            <nav>
                Date-Nite
                <tr>
                    <th>h </th>
                    <th>go here </th>
                    <th>go there </th>
                    <th>home</th>
                </tr>
            </nav>
        )
    }
}

export default Navbar
